sys_variable_value.value:
(function execute(inputs, outputs) {
  try {

    var mandatoryFieldsList = {
      "Data Source Reference": inputs.data_source_reference,
      "Report Name": inputs.report_name,
      "Report Owner Username": inputs.report_owner_username,
      "Start Date": inputs.start_date
    };

    /*var emptyMandatoryFieldsList = WorkdayUtils.checkMandatoryFields(mandatoryFieldsList);

    if (emptyMandatoryFieldsList.length > 0) {
      var errorMsg = "Following mandatory input field(s) cannot be left blank- ".concat(emptyMandatoryFieldsList);
      throw errorMsg;
    }*/

    var gdt_StartDate = new GlideDateTime(inputs.start_date);
    var gt_Start_Time = gdt_StartDate.getTime().getByFormat('HH:mm:ss');
    outputs.start_date_time = gdt_StartDate.getDate() + 'T' + gt_Start_Time;
    outputs.start_date = gdt_StartDate.getDate() + '';

    if(gs.nil(inputs.end_date) || inputs.end_date=='')
    {
      var gdt_EndDate = new GlideDateTime();
      var gt_End_Time = gdt_EndDate.getTime().getByFormat('HH:mm:ss');
      outputs.end_date_time = gdt_EndDate.getDate() + 'T' + gt_End_Time;//time as in UTC
      outputs.end_date = gdt_EndDate.getDate() + '';
    }
    else
    {
      var gdt_EndDate = new GlideDateTime(inputs.end_date);
      var gt_End_Time = gdt_EndDate.getTime().getByFormat('HH:mm:ss');
      outputs.end_date_time = gdt_EndDate.getDate() + 'T' + gt_End_Time;
      outputs.end_date = gdt_EndDate.getDate() + '';
    }

  } catch (e) {
    gs.error(e);
    throw e + ". Check error log for more information. ";
  }

})(inputs, outputs);

